  {
   "cell_type": "markdown",
   "id": "c8c2163e",
   "metadata": {},
   "source": [
    "1. **loadId**: This is a unique loan identifier. Use this for joins with the loan.csv file.\n",
    "2. **isCollection**: A loan can have a custom made collection plan if the customer has trouble making repayments as per the original schedule. TRUE means the payment is from a custom made collection plan.\n",
    "3. **installmentIndex**: This counts the nth payment for the loan. First payment is 1, 2nd payment is 2 and so on. This index resets for collection payment plans. So some loans can have 2 payments with the same installmentIndex. One from the regular plan and one from the collection plan.\n",
    "4. **paymentdate**: Effective of payment.\n",
    "5. **prinicpal**: Principal component of the payment.\n",
    "6. **fees**: Fee/ interest amount of the payment.\n",
    "7. **paymentAmount**: Total amount of the payment. Usually equals to fees + principal.\n",
    "8. **paymentStatus**: a. Checked – payment is successful.\n",
    "b. Rejected – payment is unsuccessful.\n",
    "c. Cancelled – payment is cancelled.\n",
    "d. Pending – ACH attempt has been submitted to clearing house but no response yet.\n",
    "e. Skipped – payment has been skipped.\n",
    "f. None – No ACH attempt has been made yet – usually because the payment is\n",
    "scheduled for the future.\n",
    "g. Rejected awaiting retry – retrying a failed ACH attempt.\n",
    "9. **paymentReturnCide**: ACH error codes to explain why the payment failed. "
   ]
  },
